import pdb
class Solution:
    def lengthOfLongestSubstring(self, s):
        length = len(s)
        cutlen = 1
        index = 0
        max = 0
        while ((index + cutlen)<=length):
            ptr = s[index:index+cutlen]
            #pdb.set_trace()
            if(self.HasRepeatedLetter(ptr)):
                #pdb.set_trace()
                if max<len(ptr)-1:
                    max = len(ptr)-1
                preposition = ptr.index(ptr[cutlen-1])
                #pdb.set_trace()
                cutlen = cutlen-preposition
                index = index+preposition + 1
            else:
                if max<len(ptr):
                    max = len(ptr)
                cutlen += 1
        return max

    def HasRepeatedLetter(self,string):
        #pdb.set_trace()
        for s in string:
            if s in string[:string.index(s)]+string[string.index(s)+1:]:
                return True
        return False

